import React, {Component, Fragment} from "react";

class index extends Component {
    constructor() {
        super();
        this.state = {
            data:[1,2,3,4]
        }
    }
    render() {
        return (<Fragment><div className={"Login"}>
            <span>{
                this.state.data.map((v,i)=>{
                    return  (<h3 key={i}>{v}</h3>)
                })
            }</span>
        </div></Fragment>)
    }

}

export default index;
